import React, { Component } from 'react'
import ReactDOM from 'react-dom'
import './index.css'

class Header extends Component {
  render() {
    const txt = '文本';
    const className = 'header';
    let divType = false;
    return (
      <div className={className}>
        <h1>react{txt === '' ? 1 : 2}</h1>
        {
          divType
            ? <div>typeTrue</div>
            : <div>typeFalse</div>
        }
      </div>
    )
  }
}

ReactDOM.render(
  <Header />,
  document.getElementById('root')
)
